import React from "react";

const WeatherDay = (props) => {
  const IMG_LINK = "https://developer.accuweather.com/sites/default/files/  ";
  return (
    <div>
      WeatherDay
      <p>{props.min}</p>
      <p>{props.max}</p>
      <p>{props.status}</p>
      <p>{props.date}</p>
      <p>{props.icon}</p>
      <img src={`${IMG_LINK}${props.icon}/.png`} />
    </div>
  );
};

export default WeatherDay;
